import React , { Component} from 'react';
import {  Card, Button, CardHeader, CardFooter, CardBody, CardTitle, CardText,Form, FormGroup, Label, Input, FormText } from 'reactstrap';
import { PieChart, Pie, Sector, Cell, ResponsiveContainer } from 'recharts';
class Visuals extends Component {
    render() {

        const Chart = () => {
            const data = [
                {name:"Facebook",value:20202020},
                {name:"Hussain",value:20245520},
                {name:"Ibrahim",value:100000},
            ];
            return(
                    <div>
                              <ResponsiveContainer width="100%" height="100%">
        <PieChart width={400} height={400}>
          <Pie data={data} dataKey="value" cx="50%" cy="50%" outerRadius={60} fill="#8884d8" />
          {/* <Pie data={data02} dataKey="value" cx="50%" cy="50%" innerRadius={70} outerRadius={90} fill="#82ca9d" label /> */}
        </PieChart>
      </ResponsiveContainer>
                    </div>
            )
        }
        return(
                <div className='container'>
                <div className="col-12 col-md-5 m-1">
                <Card color='secondary' style={{width:"50rem",height:"28rem"}}>

                </Card>
                </div>
                </div>
            )
    }
}

export default Visuals;
